import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Card,
  CardHeader,
  CardContent,
  Grid,
  TextField
} from "@material-ui/core";

const useStyles = makeStyles(theme => ({
  root: {
    maxWidth: 345
  }
}));

function Login() {
  const classes = useStyles();
  return (
    <Grid container justify="center" alignItems="center">
      <Card className={classes.root}>
        <CardHeader title="Sign-Up" subheader="September 14, 2016" />
        <CardContent>
          <TextField
            margin="normal"
            fullWidth
            label="Email"
            variant="outlined"
          />
          <TextField
            margin="normal"
            fullWidth
            label="Password"
            variant="outlined"
          />
        </CardContent>
      </Card>
    </Grid>
  );
}
export default Login;
